import Link from "next/link";
const Navbar = () => {
  <ul>
    <li>
      <Link href="/">
        <a>Home</a>
      </Link>

      <Link href="/about">
        <a>About</a>
      </Link>
    </li>
  </ul>;
};

export default Navbar;
